function objectNameFromHash(hash)
	local argh = tostring(hash)
	if argh == "nil" then
		print("Incorrect syntax, correct use: objectname HashNUMBERhere")
	else
	--print("=========Model Name Search Started========")
		local ModelFound = 0
		for k,v in pairs(FoundObjects)do
			local ve = v.position
			local argh = tonumber(hash)
			
			if v.HashIs == argh then
                --print ("Found Model Name: " .. v.ModNam)
				ModelFound = 1
				return v.ModNam --Returns the model name to the context menu
			end 
		end
		if ModelFound == 0 then
			print("Sorry, it seems that the hash you've entered isn't recognized (yet)")
		end
		--print("==========Model Name Search Ended=========")
	end
end